import Card from "./Card.js";


function CardList({cards}) {
    return(
<div className="elements">
    {/* <div className="element"> */}

    {cards.map((card, i) => (
      // Важный атрибут: key
      <div className="element" key={i}>
        <img className="element__image  element__image_add" src={card.text}></img>
        <h3 className="element__title">{card.author}</h3>
      </div>
    ))}
      <button name="elementIconLike" type="button" className="element__icon"></button>
      <div name="elementLikes" className="element__likes"></div>
      <button type="button" className="element__delete"></button>

    </div>
//   </div>
    ) 
}

export default CardList;

